import './App.css';
import EmpRouteDetails from './EmpRouteDetails';
import ListEmpRouteDetails from './ListEmpRouteDetails';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import { useState } from 'react';

function Routing() {
    const [activeMenu, setActiveMenu] = useState("");

    return (
        <div>
            <ul>
                <li onClick={()=>setActiveMenu("employee")}>Employees</li>
                <li onClick={()=>setActiveMenu("users")}>User</li>
                <li onClick={()=>setActiveMenu("hooks")}>Hooks</li>
            </ul>
            {
                activeMenu === "employees" &&

                <div className="container">
                    <div className="row">
                        <div className='col-md-6 col-sm-12'>
                            <EmpRouteDetails />

                        </div>
                        <div className='col-md-6 col-sm-12 listdetails'>
                            <ListEmpRouteDetails />
                        </div>

                    </div>
                </div>
            }

            {
                activeMenu === "users" &&

                <div className="container">
                    <div className="row">
                        <div className='col-md-6 col-sm-12'>
                            user details

                        </div>
                        <div className='col-md-6 col-sm-12 listdetails'>
                            user list details
                        </div>

                    </div>
                </div>
            }

            {
                activeMenu === "hooks" &&

                <div className="container">
                    <div className="row">
                        <div className='col-md-6 col-sm-12'>
                            Welcome to hooks

                        </div>
                        <div className='col-md-6 col-sm-12 listdetails'>
                            Welcome to hooks list
                        </div>

                    </div>
                </div>
            }

        </div>

    );
}

export default Routing;
